    return(
        <div className='background'>
        <div className="header">
        <h1>NETFLIX-TRAIL</h1>
        </div>
        <div className='sub-header'>
        <h3>Watch exclusive Netflix movie trailers</h3>
        
        </div>
        
       
        

        </div>
    )
};

export default Landing;
